import './App.css';
import Home from './pages/Home';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';

import Leftbar from './component/Leftbar';
function App() {
  return (
    <div className="App">
      <Leftbar></Leftbar>





      <Router>
      <Switch>
        <Route exact path="/" component={Home} />

      </Switch>
    </Router>
    </div>


  );
}

export default App;
